    false,nt"url": null,nt"notes": "This annual narrative report for Chautauqua
    National Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar
    year. The report includes a planning section which discusses the management plan.
    Refuge administration is outlined; information about personnel, youth programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands and wilderness areas. The wildlife section of the report
    discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, fisheries resources, marking and banding, and
    disease control. The public uses of the Refuge described in this report include
    interpretive programs, hunting, fishing, wildlife observation, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about rehabilitation, major maintenance, equipment replacement, and
    communication systems. Cooperative programs and items of interest are provided at
